export default function Card(props){
    return(
        <div className="card">
            <div className="dados">
                <h3 className="title-card">
                    {props.marca}
                </h3>
                <p>
                    {props.veiculo}
                </p>
                <p>
                    {props.another}
                </p>
            </div>
            <input type="checkbox" id="checkboxFav" />
            <label htmlFor="checkboxFav">
                F
            </label>
        </div>
    )
}
